def parse_nested_parens(paren_string: str) -> List[int]:
    def find_max_depth(s: str, depth: int, max_depth: int) -> int:
        if not s:
            return max_depth
        if s[0] == '(':
            return find_max_depth(s[1:], depth + 1, max_depth)
        elif s[0] == ')':
            return find_max_depth(s[1:], depth - 1, max(max_depth, depth))
        return max_depth

    groups = paren_string.split()
    return [find_max_depth(g, 0, 0) for g in groups]

def parse_nested_parens(paren_string: str) -> List[int]:
    result = []
    for group in paren_string.split():
        max_depth = 0
        depth = 0
        for char in group:
            if char == '(':
                depth += 1
                max_depth = max(max_depth, depth)
            elif char == ')':
                depth -= 1
        result.append(max_depth)
    return result

