def parse_nested_parens(paren_string: str) -> List[int]:
    def max_depth(paren_string):
        max_depth = 0
        current_depth = 0
        for paren in paren_string:
            if paren == '(':
                current_depth += 1
                max_depth = max(max_depth, current_depth)
            elif paren == ')':
                current_depth -= 1
        return max_depth

    result = []
    for string in paren_string.split():
        result.append(max_depth(string))
    return result

