        raise ValueError("xs must have even number of coefficients")
    if not xs:
        raise ValueError("xs must not be empty")

    max_coeff = max(xs)
    if max_coeff == 0:
        raise ValueError("xs must have a non-zero largest coefficient")

    # Use the bisection method to find the zero point
    a, b = float('-inf'), float('inf')
    while True:
        mid = (a + b) / 2
        if poly(xs, mid) > 0:
            a = mid
        else:
            b = mid
        if abs(a - b) < 1e-6:
            break
    return mid

