def max_fill(grid, bucket_capacity):
    import math

    if not grid:
        return 0

    rows = len(grid)
    cols = len(grid[0])

    def empty_well(well_row, well_col):
        filled_units = 0
        while well_row < rows and grid[well_row][well_col] == 1:
            filled_units += 1
            well_row += 1
        return filled_units

    total_buckets = 0
    for col in range(cols):
        well_row = 0
        while well_row < rows:
            filled_units = empty_well(well_row, col)
            if filled_units > 0:
                total_buckets += math.ceil(filled_units / bucket_capacity)
                well_row += filled_units
            else:
                well_row += 1

    return total_buckets

