    def dfs(x, y, k, path):
        nonlocal min_path
        if k == 0:
            if min_path is None or path < min_path:
                min_path = path
            return

        if x < 0 or x >= N or y < 0 or y >= N:
            return

        if (x, y) in visited:
            return

        visited.add((x, y))

        path.append(grid[x][y])
        dfs(x + 1, y, k - 1, path)
        dfs(x - 1, y, k - 1, path)
        dfs(x, y + 1, k - 1, path)
        dfs(x, y - 1, k - 1, path)

        path.pop()
        visited.remove((x, y))

    for i in range(N):
        for j in range(N):
            visited = set()
            dfs(i, j, k, [])

    return min_path

