    """
    Your task is to implement a function that will simplify the expression x * n. 
    The function returns True if x * n evaluates to a whole number and False otherwise.
    Both x and n, are string representation of a fraction, and have the following format, 
    <numerator>/<denominator> where both numerator and denominator are positive whole numbers. 

    You can assume that x, and n are valid fractions, and do not have zero as denominator. 

    simplify("1/5", "5/1") = True
    simplify("1/6", "2/1") = False
    simplify("7/10", "10/2") = False
    """
    def gcd(a, b):
        while b:
            a, b = b, a % b
        return a

    def lcm(a, b):
        return a * b // gcd(a, b)

    num1, denom1 = map(int, x.split('/'))
    num2, denom2 = map(int, n.split('/'))

    new_numerator = num1 * num2
    new_denominator = denom1 * denom2

    if new_numerator % new_denominator == 0:
        return True
    else:
        if new_numerator == new_denominator:
            return True
        else:
            gcd_value = gcd(new_numerator, new_denominator)
            if new_numerator // gcd_value == new_denominator // gcd_value:
                return True
            else:
                return False

