    def gcd(a, b):
        while b:
            a, b = b, a % b
        return a

    def to_fraction(s):
        num, den = map(int, s.split('/'))
        return num, den

    def from_fraction(num, den):
        return '{}/{}'.format(num, den)

    num_x, den_x = to_fraction(x)
    num_n, den_n = to_fraction(n)

    num = num_x * num_n
    den = den_x * den_n

    gcd_value = gcd(num, den)
    num //= gcd_value
    den //= gcd_value

    if num % den == 0:
        return True
    else:
        return False

